Diagnosis
. Male palp (
Figs 17a–b
) with low blunt tipped TA. MA with elongate proximal projection, curving prolaterally with blunt rounded tip and with short narrow prolateral projection. Embolus with bluntly pointed tip and sometimes with expanded section near base. Palpal patella with one dorsal spine, palpal tibia with one dorsal and one prolateral stout spine. Female epigynum (
Figs 17c–d
) with pronounced lateral teeth. Tarsal organ rod like, situated proximally to trichobothria.
